import React from 'react';

import './App.css';

import Artwave from "./Components/Artwave";

class App extends React.Component {
  state = {
    selected: "artwave"
  }

  render() {
    return (
      <div className="container">
        <header>
          <h1>devin poore portfolio</h1>
        </header>

        <div className="row">

          <div id="projectButtons" className="col-md-2">
             <button className="btn btn-md">artwave</button>
             <button className="btn btn-md">artwave 2.0</button>
             <button className="btn btn-md">carpoolify</button>
             <button className="btn btn-md">carpoolify 2.0</button>
             <button className="btn btn-md">spawtted</button>
             <button className="btn btn-md">chorechat</button>
          </div>

          {/* This should be a ternary depending on whether the sidebar 'about' is showing */}
          <div id="projectDesc" className="col-md-6">
            {/* <h2>Selected project description here</h2> */}
            <Artwave />
          </div>

          <div id="about" className="col-md-4">
            <h2>About Section</h2>
          </div>

        </div>

      </div>
    );
  }
}

export default App;
